import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the "Featured Products" section to be visible
    await page.waitForSelector('text=Featured Products', { timeout: 5000 });

    // Find a product card by its title text (use a unique product title)
    // We'll use the iPhone 15 Pro Max as it's unique in the mock data
    const productTitle = "Apple iPhone 15 Pro Max, 256GB, Natural Titanium";
    const productCard = await page.waitForSelector(`.product-card:has-text("${productTitle}")`, { timeout: 5000 });

    // Take a screenshot before opening the modal
    const beforeModalShot = path.join(screenshotsDir, 'step_2_before_modal.png');
    await page.screenshot({ path: beforeModalShot });
    screenshots.push(beforeModalShot);

    // Click the product card to open the Product Detail Modal
    await productCard.click();

    // Wait for the modal to appear by waiting for the modal's content (use a unique selector inside modal)
    // The modal has id="productModal" and contains .product-detail-title with the product title
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector(`.product-detail-title:has-text("${productTitle}")`, { timeout: 5000 });

    // Take a screenshot of the open modal
    const modalShot = path.join(screenshotsDir, 'step_3_modal_open.png');
    await page.screenshot({ path: modalShot });
    screenshots.push(modalShot);

    // Extract some data from the modal to verify
    const modalTitle = await page.textContent('.product-detail-title');
    const modalPrice = await page.textContent('.product-detail-price');
    const modalInStock = await page.textContent('.stock-info');

    return {
      success: true,
      action: "Opened Product Detail Modal for iPhone 15 Pro Max",
      extractedData: {
        modalTitle: modalTitle ? modalTitle.trim() : null,
        modalPrice: modalPrice ? modalPrice.trim() : null,
        modalInStock: modalInStock ? modalInStock.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
